    return this.blizzard.get(`/d3/data/item-type`, args);
  }

  return this.blizzard.get(`/d3/data/item-type/${id}`, args);
};

/**
 * Fetch Diablo 3 era data.
 *
 * @param {Object} args
 * @param {String} [args.id] An era ID
